import { BrowserRouter, Route, Routes } from "react-router-dom"
import LoginView from "./components/view/LoginView/LoginView";
import RegisterDataView from "./components/view/RegisterView/RegisterDataView";
import RegisterAdressView from "./components/view/RegisterView/RegisterAdressView";



const AppRoutes = () => {
    return (
        <BrowserRouter>

            <Routes>
                <Route path="/" element = {<LoginView />}/>
                <Route path="/RegisterData" element = {<RegisterDataView />}/>
                <Route path="/RegisterAdress" element = {<RegisterAdressView />}/>
                

            </Routes>

        </BrowserRouter>
    )
}

export default AppRoutes;
